import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import Takamatsu from "./pages/Takamatsu";
import Tokushima from "./pages/Tokushima";
import Ehime from "./pages/Ehime";
import Food from "./pages/Food";
import SiteFooter from "./components/SiteFooter";

<SiteFooter
  authorImage="/images/me-on-train.jpg"
  bannerImage="/images/olive-island-sunset.jpg"
  bannerAlt="View of Seto Inland Sea from Shodoshima"
  authorDescription={`四國八天七夜紀錄：\n一個沒開車、拍照不太會，但玩得很開心的大學生。`}
/>

export default function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/takamatsu" element={<Takamatsu />} />
        <Route path="/tokushima" element={<Tokushima />} />
        <Route path="/ehime" element={<Ehime />} />
        <Route path="/food" element={<Food />} />
      </Routes>
    </Router>

  );
}
